import "./TableData.css";

function TableData(props) {
  var unit = "";
  var num = props.data;
  var name = props.name;
  var colour = "black";
  if (props.name === "occupied") {
    name = "Seat Availability";
    if (props.data == 0){
      num = "Occupied";
      colour = "red";
    }
    else if (props.data == 1){
      num = "Leaving Soon";
      colour = "blue";
    }
    else{
      num = "Vacant";
      colour = "green";
    }
  }
  return (
    <div className="box">
      <label className="title">{props.name}</label>
      <div className="valuebox">
        <label className="val " style={{color: "red"}}>{props.data}</label>
      </div>
    </div>
  );
}

export default TableData;
